import styles from "./NavBar.module.css";
import { Link } from "react-router-dom";

export default function NavBar() {
  return (
    <>
      <div className={styles.Contenedor}>h</div>
      <div className={styles.ContenedorNavegacion}>
        <Link className={styles.Rutas}>Info</Link>
        <Link className={styles.Rutas}>Home</Link>
        <Link className={styles.Rutas}>Crea tu receta!</Link>
        <Link to={"/"} className={styles.Rutas}>
          Dietas
        </Link>
      </div>
    </>
  );
}
